    var index = 2; // start from deg330 - p6


    // functions
    this.rotate = function (playerFrom, playerTo, callback) {
        var pfx = this.findKeyframesPrefix();
        var from = this.getBottleDeg(playerFrom.deg);
        var to = 720 + this.getBottleDeg(playerTo.deg); // 2 full circles + selected deg

        var keyframes = '@' + pfx + 'keyframes spin { ' +
            '0% {' + pfx + 'transform:rotate( ' + from +'deg ) }' +
            '100% {' + pfx + 'transform:rotate( ' + to + 'deg ) }' +
            '}';
        document.styleSheets[0].insertRule(keyframes, 0);
        bottle.addEventListener("webkitAnimationEnd", callback);
        bottle.addEventListener("animationend", callback);
        bottle.classList.add('rotating');
    };


    this.rotateBottle = () => {
        setTimeout(this.start, 500);
    };


    this.pulseBottle = () => {

        var onPulseEnd = () => {
            bottle.removeEventListener("webkitAnimationEnd", onPulseEnd);
            bottle.removeEventListener("animationend", onPulseEnd);
            // show tap message
            tapPopup.style.display = "flex";
            bottle.classList.remove('pulsing');
            tapEnabled = true;
            bottle.style.display = "none";

        };
        this.switchTurn();
        bottle.addEventListener("webkitAnimationEnd", onPulseEnd);
        bottle.addEventListener("animationend", onPulseEnd);
        bottle.classList.add('pulsing');
    };


    this.switchTurn = () => {
        turn.style.display = "block";
        turn.style.transform = "rotate(" + currentPlayer.deg + "deg) translate(22vw)";
    }

    this.onRotationEnd = () => {
        selectedPlayer.src.classList.add('glow');
        bottle.style.transform = "rotate(" + this.getBottleDeg(selectedPlayer.deg) + "deg)";
        turn.style.display = "none";
        bottle.removeEventListener("webkitAnimationEnd", this.onRotationEnd);
        bottle.removeEventListener("animationend", this.onRotationEnd);
        document.styleSheets[0].deleteRule(0);
        bottle.classList.remove('rotating');
        setTimeout(()=>{
            currentPlayer.src.classList.remove('glow');
            selectedPlayer.src.classList.remove('glow');
            kissPopup.style.display = "flex";
            pk1.src = currentPlayer.src.src;
            pk2.src = selectedPlayer.src.src;
        }, 1000);
    }

    this.start = () => {
        bottle.style.display = "block";
        currentPlayer.src.classList.add('glow');
        this.rotate(currentPlayer, selectedPlayer, this.onRotationEnd);
    }

    this.getBottleDeg = (deg) => {
        return 360-215+deg;
    }



    this.findKeyframesPrefix = () => {
        var
            animationstring = 'animation',
            keyframeprefix = '',
            domPrefixes = 'Webkit Moz O ms Khtml'.split(' '),
            pfx = '';
        if (bottle.style.animationName) {
            return "";
        }
        else {
            for (var i = 0; i < domPrefixes.length; i++) {
                if (bottle.style[domPrefixes[i] + 'AnimationName'] !== undefined) {
                    pfx = domPrefixes[i];
                    animationstring = pfx + 'Animation';
                    keyframeprefix = '-' + pfx.toLowerCase() + '-';
                    return keyframeprefix;
                }
            }
        }
    };


    this.btnClick = () => {
        kissPopup.style.display = "none";
        installPopup.style.display = "flex";
    };

    this.canvasClick = () => {
        if (!tapEnabled) {
            return;
        }
        tapPopup.style.display = "none";
        this.rotateBottle();
        //setTimeout(this.rotateBottle, 500);
    };

    this.init = () => {
        currentPlayer = this.usr;
        selectedPlayer = this.players[index];
        setTimeout(this.pulseBottle, 500);
    };

};




window.onload = function () {
    window.scene = new Scene();
    scene.init();
};

yesClick = () => {
    window.scene.btnClick();
};

noClick = () => {
    window.scene.btnClick();
};

canvasClick  = () => {
    window.scene.canvasClick();
};

onInstallClick = () => {
    FbPlayableAd.onCTAClick();
